from queue import Queue
class Solution:
    def numEnclaves(self, A: 'List[List[int]]') -> int:
        q = Queue()
        for i in range(len(A)):
            for j in range(len(A[0])):
                if i == 0 or j == 0 or i == len(A) - 1 or j == len(A[i]) - 1:
                    if A[i][j] == 1:
                        q.put((i, j))
        while not q.empty():
            x, y = q.get()
            if A[x][y] == 0:
                continue
            A[x][y] = 0
            for dx, dy in ((0, 1), (0, -1), (1, 0), (-1, 0)):
                if 0 <= x + dx < len(A) and 0 <= y + dy < len(A[0]) and A[x + dx][y + dy] == 1:
                    q.put((x + dx, y + dy))
        return sum(A[i][j] for j in range(len(A[0])) for i in range(len(A)))


